import React from 'react';
import Topbar from './Topbar';
import Menu from './Menu';

function App() {
  return (
    <div
      style={{
        width: '1440px',
        margin: '0 auto',
        boxSizing: 'border-box',
        minHeight: '100vh',
        background: '#fff',
      }}
    >
      <Topbar />
      <Menu />
      {/* Other homepage sections will go here */}
    </div>
  );
}

export default App;
